searchIndex["walkdir"] = {"doc":"Crate `walkdir` provides an efficient and cross platform implementation\nof recursive directory traversal. Several options are exposed to control\niteration, such as whether to follow symbolic links (default off), limit the\nmaximum number of simultaneous open file descriptors and the ability to\nefficiently skip descending into directories.","items":[[3,"WalkDir","walkdir","A builder to create an iterator for recursively walking a directory.",null,null],[3,"Iter","","An iterator for recursively descending into a directory.",null,null],[3,"DirEntry","","A directory entry.",null,null],[3,"IterFilterEntry","","A recursive directory iterator that skips entries.",null,null],[3,"Error","","An error produced by recursively walking a directory.",null,null],[6,"Result","","A result type for walkdir operations.",null,null],[8,"WalkDirIterator","","A trait for recursive directory iterators.",null,null],[10,"skip_current_dir","","Skips the current directory.",0,null],[11,"filter_entry","","Yields only entries which satisfy the given predicate and skips\ndescending into directories that do not satisfy the given predicate.",0,null],[11,"new","","Create a builder for a recursive directory iterator starting at the\nfile path `root`. If `root` is a directory, then it is the first item\nyielded by the iterator. If `root` is a file, then it is the first\nand only item yielded by the iterator.",1,{"inputs":[{"name":"p"}],"output":{"name":"self"}}],[11,"min_depth","","Set the minimum depth of entries yielded by the iterator.",1,null],[11,"max_depth","","Set the maximum depth of entries yield by the iterator.",1,null],[11,"follow_links","","Follow symbolic links. By default, this is disabled.",1,null],[11,"max_open","","Set the maximum number of simultaneously open file descriptors used\nby the iterator.",1,null],[11,"sort_by","","Set a function for sorting directory entries.",1,null],[11,"into_iter","","",1,null],[11,"next","","",2,null],[11,"skip_current_dir","","",2,null],[11,"path","","The full path that this entry represents.",3,null],[11,"path_is_symbolic_link","","Returns `true` if and only if this entry was created from a symbolic\nlink. This is unaffected by the `follow_links` setting.",3,null],[11,"metadata","","Return the metadata for the file that this entry points to.",3,null],[11,"file_type","","Return the file type for the file that this entry points to.",3,null],[11,"file_name","","Return the file name of this entry.",3,null],[11,"depth","","Returns the depth at which this entry was created relative to the root.",3,null],[11,"clone","","",3,null],[11,"fmt","","",3,null],[11,"next","","",4,null],[11,"skip_current_dir","","",4,null],[11,"fmt","","",5,null],[11,"path","","Returns the path associated with this error if one exists.",5,null],[11,"loop_ancestor","","Returns the path at which a cycle was detected.",5,null],[11,"depth","","Returns the depth at which this error occurred relative to the root.",5,null],[11,"description","","",5,null],[11,"cause","","",5,null],[11,"fmt","","",5,null]],"paths":[[8,"WalkDirIterator"],[3,"WalkDir"],[3,"Iter"],[3,"DirEntry"],[3,"IterFilterEntry"],[3,"Error"]]};
